import React from 'react';

function BGcolor() {
  // Define an inline style using a JavaScript object
  const divStyle = {
    backgroundColor: 'blue',
    color: '#155371',
    padding: '20px',
    fontSize: '18px',
  };

  return (
    <div style={divStyle}>
      This is a div with inline styles.
    </div>
  );
}

export default BGcolor;
